  false,\n\t\"url\": null,\n\t\"notes\": \"The benthic habitats of the Florida Keys
  were mapped from a series of 450 aerial photographs. Ecologists outlined the boundaries
  of specific habitat types by interpreting color patterns on the photographs. Benthic
  habitats were classified into four major categories-corals, seagrasses, hardbottom,
  and bare substrate-and 24 subcategories, such as sparse seagrass and patch reef.
  Habitat boundaries were georeferenced and digitized to create computer maps. These
  digital data were then incorporated into a geographic information system for direct
  electronic mapping.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
